def changes_needed(letters):

    letters = letters.lower()

    if len(letters) % 4 != 0:
        print("length invalid")
        return None

    histogram = {}
    histogram["q"] = 0
    histogram["w"] = 0
    histogram["e"] = 0
    histogram["r"] = 0

    for letter in letters:
        if letter in histogram:
            histogram[letter] += 1
        else:
            print("invalid letter")
            return None

    print(histogram)

    q_count = histogram["q"] - len(letters) / 4
    w_count = histogram["w"] - len(letters) / 4
    e_count = histogram["e"] - len(letters) / 4
    r_count = histogram["r"] - len(letters) / 4

    start_index = 0
    current_best = len(letters)

    extra_letter_counts = {}
    if q_count > 0:
        extra_letter_counts["q"] = q_count
    if w_count > 0:
        extra_letter_counts["w"] = w_count
    if e_count > 0:
        extra_letter_counts["e"] = e_count
    if r_count > 0:
        extra_letter_counts["r"] = r_count

    min_changes = sum(extra_letter_counts.values())

    while start_index < len(letters) and start_index <= len(letters) - min_changes:

        print(extra_letter_counts)
        print(len(extra_letter_counts))
        current_index = start_index
        while current_index < len(letters) and len(extra_letter_counts) != 0:

            letter = letters[current_index]
            print("considering letter",letter, "at index",current_index)
            if letters[current_index] in extra_letter_counts:
                extra_letter_counts[letter] -= 1
                if extra_letter_counts[letter] == 0:
                    del extra_letter_counts[letter]

            current_index += 1

        print("replacing", letters[start_index:current_index])
        if current_index - start_index < current_best and len(extra_letter_counts) == 0:
            print("current",current_index - start_index,"best",current_best)
            current_best = current_index - start_index
        else:
            print("not enough replacements or same as best")

        if current_best == min_changes:
            return current_best
        start_index += 1
        if q_count > 0:
            extra_letter_counts["q"] = q_count
        if w_count > 0:
            extra_letter_counts["w"] = w_count
        if e_count > 0:
            extra_letter_counts["e"] = e_count
        if r_count > 0:
            extra_letter_counts["r"] = r_count

    return current_best

# second attempt
def balanced_string(s):

    histogram = {}

    for letter in s:
        if letter in histogram:
            histogram[letter] += 1
        else:
            histogram[letter] = 1

    print(histogram)

    all_letters = sum(histogram.values())

    if "Q" in histogram:
        if histogram["Q"] > all_letters / 4:
            histogram["Q"] = histogram["Q"] - all_letters // 4
        else:
            del histogram["Q"]
    if "W" in histogram:
        if histogram["W"] > all_letters / 4:
            histogram["W"] = histogram["W"] - all_letters // 4
        else:
            del histogram["W"]
    if "E" in histogram:
        if histogram["E"] > all_letters / 4:
            histogram["E"] = histogram["E"] - all_letters // 4
        else:
            del histogram["E"]
    if "R" in histogram:
        if histogram["R"] > all_letters / 4:
            histogram["R"] = histogram["R"] - all_letters // 4
        else:
            del histogram["R"]

    print(histogram)

    letter_counts = {}
    letter_counts["Q"] = 0
    letter_counts["W"] = 0
    letter_counts["E"] = 0
    letter_counts["R"] = 0

    min_changes = sum(histogram.values())
    print(min_changes)

    for i in range(min_changes):

        letter_counts[s[i]] += 1

#    print(letter_counts)
    print(letter_counts)
    start_index = 0
    end_index = min_changes - 1
    best_answer = len(s)

    print("starting", letter_counts)
    print(histogram)

    while start_index < all_letters - min_changes and end_index < all_letters:

        all_match = True
        for key in histogram:
            if letter_counts[key] < histogram[key]:
                print(key, "is not higher in counts")
                all_match = False
                break

        if all_match:

            current_answer = sum(letter_counts.values())
            if current_answer < best_answer:
                best_answer = current_answer
                print("new best answer is", best_answer)
                if best_answer == min_changes:
                    return best_answer

            print("all letters in, trying to improve by bumping start")
            letter_counts[s[start_index]] -= 1
            start_index += 1
            print(s[start_index:end_index+1])

        else:
            print("no match, bumping end")
            end_index += 1
            if(end_index < len(s)):
                letter_counts[s[end_index]] += 1

        print("current counts:", letter_counts)

    return min(best_answer,sum(letter_counts.values()))

print("best answer", balanced_string("QEEWWRWWRQWRQREWRQREWWQRREWERRWRWEEQWWEWWRRW"))
